const styles = {
  button: {
    padding: '10px 30px',
    color: 'white',
    borderRadius: '6px',
    fontWeight: 'bold',
  },
  success: {
    backgroundColor: 'green',
  },
  rootItem: {
    margin: '0% auto',
  },
  card: {
    marginTop: '30px',
  },
  boxConfig: {
    minHeight: '60px',
    display: 'flex',
    alignItems: 'end',
  },
}

export default styles
